import React from 'react';
import {Link, NavLink} from "react-router-dom";

const Home = () => {
    return (
        <div>
            <h4>Home Page</h4>
            <p>Lorem Ipsum</p>
            <nav>
                <ul className="rectangle">
                    <li><Link to="/">CVA Ketenzorg</Link></li>
                    <li><NavLink to="/Begeleiding">Begeleiding</NavLink></li>
                    <li><NavLink to="/Professionals">Professionals</NavLink></li>
                    <li><NavLink to="/Informatie">Informatie</NavLink></li>
                    <li><NavLink to="/Contact">Contact</NavLink></li>
                </ul>
            </nav>
        </div>
    )
}

export default Home;
